function codeToCountry(code: string): string {
  if (code.includes('/')) {
    const parts = code.split('/')
    parts[0] = codeToCountry(parts[0])
    return parts.join('/')
  } else {
    return iataMap[code] || countryCodeMap[code] || code
  }
}

